  cmpgt c,e
   jmp [preset_x]
  
  dsend c,0x0,0x00  ;set xpos
  dsend d,0x0,0x01  ;set ypos
  dsend f,0x0,0x06
  inc c
  jmp [ploop1]
 
 preset_x:
  dsend g,0x0,0x07  ;updating screen
  mov c,0
  inc d
  jmp [ploop0]

inc_address:
 mov g,0xFFFF
 cmpeq b,g
  inc a
 inc b
 ret

pend:
mov e,0xFFFF
split e,h,e,0
raw 0x12,0x41,0x10,0x00,0x00,0x00 ;wram VRAM,e
raw 0x12,0x71,0x10,0x00,0x00,0x00 ;wram VRAM,e
script:
mov c,0
mov d,0
raw 0x11,0x41,0x10,0x00,0x00,0x00 ;rram VRAM,e
raw 0x11,0x71,0x10,0x00,0x00,0x00 ;rram VRAM,e
combine e,e,h,0
mov h,10
cmpeq e,h
 jmp [end_script]
inc e
disp e
dsend e,0x0,0x01  ;set ypos
split e,h,e,0
raw 0x12,0x41,0x10,0x00,0x00,0x00 ;wram VRAM,e
raw 0x12,0x71,0x10,0x00,0x00,0x00 ;wram VRAM,e
wait 0
mov e,1
mov f,0x10
;--[[COLORPALLET]]--
setcp:
 cmpeq e,f
  jmp [retcp]
 rrom a,b, h
 call [inc_address]
 dsend h,0x0,0x02
 rrom a,b, h
 call [inc_address]
 dsend h,0x0,0x03
 rrom a,b, h
 call [inc_address]
 dsend h,0x0,0x04
 dsend e,0x0,0x05
 dsend e,0x0,0x00  ;set xpos
 dsend f,0x0,0x06
 inc e
 jmp [setcp]
retcp:
mov h,239          ;height0
mov e,425          ;width/TMP
;disp a
;disp b
;wait 0
call [render]
;call [inc_address]
jmp [script]

;--[[End Rendering]]--
end_script:
 mov b,1
 loop:
  dsend g,0x0,0x07  ;updating screen
  drecv a,0x1,0x00  ;get controller0 input
  cmpeq a,b         ;if (A) is pressed...
   jmp [halt]       ;\true
  jmp [loop]        ;\false 
 
halt:
 disp a
 hlt